import React from 'react'

const styles = {
    backgroundColor: "#060809",
    minHeight: "100vh",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    fontSize: "calc(10px + 2vmin)",
    color: "white",
}

const Home = () => {
    return (
        <div style={styles}>
            <h1>NEAR <span style={{ color: "#fff" }}>Gang Couture</span></h1>
        </div>
    )
}

export default Home
